import React from 'react';

function Home() {
    return (
        <div>
            <div className="homeTextBox">
                    <div className="weatherText">
                        <h1>Welcome!</h1>
                        <pre>My name is Laviero, and these are some things I made
                            <br/>send that query to a weather API, retrieve the weather data from that API, 
                            <br/>and display it on react elements. The API used for the weather information 
                            <br/>is WeatherApi.com
                        </pre>
                    </div>
                </div>
        </div>
        
    );
}

export default Home;
